import React from 'react'
function UserShow(){
    const rootDiv = document.getElementById("root");
    const article= JSON.parse(rootDiv.getAttribute("article"));
    return(
        <>
        <h1>{article.title}</h1>
        <p>{article.content}</p>
        </>
    )
}

export default UserShow
